using System.Collections;
using System.Collections.Generic;
using UnityEngine;
using UnityEngine.Networking;

public class WWWRequest : MonoBehaviour
{
    public string url = "data:image/jpeg;base64,";
    public UnityEngine.UI.RawImage rawImg;
    // Start is called before the first frame update
    void Start()
    {
        StartCoroutine(SetRawImage());
    }

    IEnumerator SetRawImage()
    {
        UnityWebRequest www = UnityWebRequestTexture.GetTexture(url);

        yield return www.SendWebRequest();

        if (www.result == UnityWebRequest.Result.Success)
        {
            rawImg.texture = ((DownloadHandlerTexture)www.downloadHandler).texture;
        }
        else
        {
            Debug.Log("에러발생");
        }
    }
}
